START TRANSACTION;
DROP TABLE IF EXISTS `chassis`;
CREATE TABLE IF NOT EXISTS `chassis` (
	`ID`	INT(11) NOT NULL UNIQUE AUTO_INCREMENT,
	`Url`	TEXT,
	`Price`	DECIMAL(10,2),
	`Name`	TEXT,
	`Manufacturer`	TEXT,
	`Image`	TEXT,
	`Image_Url`	TEXT,
	`Chassis_type`	TEXT,
	`Dimensions`	TEXT,
	`Color`	TEXT,
	`Compatibility`	TEXT,
	PRIMARY KEY(`ID`)
);
DROP TABLE IF EXISTS `cpu`;
CREATE TABLE IF NOT EXISTS `cpu` (
	`ID`	INT(11) NOT NULL UNIQUE AUTO_INCREMENT,
	`Url`	TEXT,
	`Price`	DECIMAL(10,2),
	`Name`	TEXT,
	`Manufacturer`	TEXT,
	`Image`	TEXT,
	`Image_Url`	TEXT,
	`Core_Count`	TEXT,
	`Thread_Count`	TEXT,
	`Base_Clock`	TEXT,
	`Cache`	TEXT,
	`Socket`	TEXT,
	`Cpu_Cooler`	TEXT,
	`TDP`	TEXT,
	`Integrated_GPU`	TEXT,
	PRIMARY KEY(`ID`)
);
DROP TABLE IF EXISTS `cpu_cooler`;
CREATE TABLE IF NOT EXISTS `cpu_cooler` (
	`ID`	INT(11) NOT NULL UNIQUE AUTO_INCREMENT,
