	`ID`	INT(11) NOT NULL UNIQUE AUTO_INCREMENT,
	`Url`	TEXT,
	`Price`	DECIMAL(10,2),
	`Name`	TEXT,
	`Manufacturer`	TEXT,
	`Image`	TEXT,
